import React, { useEffect } from 'react';
import { useLocation, NavLink} from 'react-router-dom';

// Importamos los estilos 
import '../styles/navbar.css';

export default function Navbar(){

    const UbicacionAct = useLocation(); //Ruta actual en la que se está usando el navbar


    /* Como esto tiene que ser responsivo, vamos a usar Bootstrap */

    return (
      <nav class="navbar navbar-expand-lg bg-body-tertiary">
              <div class="container-fluid">
                <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                  <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                  <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                    <li class="nav-item">
                      <a class="nav-link active" href="#">Home</a>
                    </li>
                    <li class="nav-item">
                      <a class="nav-link" aria-current="page" href="cv.html">My CV</a>
                    </li>
                    <li class="nav-item">
                      <a class="nav-link" href="timetable.html">Weekly Timetable</a>
                    </li>
                    <li class="nav-item">
                      <a class="nav-link" href="photos.html">Photos</a>
                    </li>
                  </ul>
                </div>
              </div>
            </nav>
    );



}
